INSERT INTO `tbltickets` VALUES (67,'505674',1,0,0,'fraud@2co.com','fraud@2co.com','','9dD4dO6X','2013-10-02 14:10:03','Important Message from 2Checkout: Transaction Review','In an effort to minimize your losses due to fraud, we review each sale through our fraud systems and processes. Monitoring your account for fraud is something that we perform jointly with you. While we have some sophisticated tools working on your behalf, no one knows your business better than you do.\r\n\r\nThere are several things you can do, as a Seller, to help lower fraud through your account, decrease your chargeback rate and ultimately, improve your bottom line. https://www.2checkout.com/fraud-prevention-tips/\r\n\r\nOutlined below are the results of our most recent review for account 2019672:\r\n\r\n-------------------------------------------------\r\nPASSED: The following orders have successfully cleared through our systems:\r\nSeller ID	Order ID	Comments\r\n2019672		5098768118\r\n\r\n-------------------------------------------------\r\nFAILED: These sales have been determined to be fraudulent, and have already been canceled, no further action is necessary.\r\n&lt;No sales in &quot;failed&quot; section &gt;\r\n\r\n-------------------------------------------------\r\nON HOLD: We are currently awaiting further information about these sales. Please place delivery of these orders on hold until they have a status of PASSED.\r\n&lt;No sales in &quot;hold&quot; section &gt;\r\n\r\nIn order to check the status of or take action on a sales transaction, simply login to your 2Checkout account\r\nhttps://www.2checkout.com/va/.\r\n\r\nOur team is here to help. If you have questions or would like to discuss how to look for fraud within your account, please call or reply to this email.\r\n\r\nThank you,\r\n\r\nFraud Team\r\n\r\n2Checkout.com\r\n\r\nfraud@2co.com','Closed','Medium','','','2013-10-02 14:10:03',0,1,'',0,'0000-00-00 00:00:00',''),(66,'694230',1,0,0,'sales@2co.com','sales@2co.com','','nlq