arty, then you need to edit your DNS settings and point your A record to Shopify&#039;s IP address, which is 23.227.38.32 Copy, and your CNAME record to point to shops.myshopify.com Copy.\r\n\r\nLog in to the account you have with your domain provider.\r\n\r\nFind your DNS settings. Look for your account admin panel, or your domain management area, or DNS configuration, or similar.\r\n\r\nEdit your A record to point to Shopify&#039;s IP address 23.227.38.32 Copy\r\n\r\nThe admin panel might feature drop-downs or editable fields, or you might have to check boxes or edit a table. In the admin, you need to:\r\n\r\nenter or choose the @ symbol, or A record\r\nenter Shopify&#039;s IP address 23.227.38.32 Copy as the destination for the A record.\r\nSave the A Record (click Save, Save Zone File, Add Record, or similar).\r\n\r\nFind the CNAME record in your DNS settings.\r\n\r\nChange your www CNAME record to point to shops.myshopify.com Copy. Often, you need to provide just the prefix without the dot, but for some domain providers you need the whole subdomain. Use the existing entries as a guide, or follow your provider&#039;s instructions. CNAME records must always point to a domain name, never to an IP address.\r\n\r\nSave the CNAME Record (usually by clicking Save or Add record or similar).\r\n ','Answered','Low','','','2017-07-12 18:45:25',0,1,'1',0,'0000-00-00 00:00:00',''),(772,'743909',1,2546,0,'','','','qi0xXxsy','2017-07-12 00:04:56','Domain transfer','I would like to transfer out my domain: VIRTUALOFFICESLA.COM\r\n\r\nWhen I enter the transfer code in the receiving hosting I see an message that says: &quot;You will need to unlock the domain at the TurnCommerce, Inc. DBA NameBright.com before a transfer can take place. An email was sent to virtualofficesla.com@NameBrightPrivacy.com , the Administrative contact for virtualofficesla.com containing the verification code. Enter the code in the field above, and click Continue.&quot;\r\n\r\nThe domain looks unlocked in